import './Blood.sol';

contract Hospital is Blood{
    address public Bloodaddr = 0x7340b5060201f191e5512632f8B17369Dea96bFa;
    string public name;
    address payable public haddr = address(0xEaa2a20e47bC99732aE0c06BE448E191C42E45bc);
    uint public bagcount = 0;

    struct Bag{
        uint id;
        uint btype;
        string owner_name;
        uint expiry;
        address payable owner;
    }
    Bag[] public bags;

    function setOriginContract(address _addr) public returns(bool) {
        Bloodaddr = _addr;
        return true;
    }

    constructor() public{
        name = "Deep Gosalia";
        for (uint i = 0; i < 3; i++) {
            bags[i] = Bag(i+1, 1, 'ABC Hospital', 120, haddr);
            bagcount ++;
        }
    }

    mapping(uint => uint[]) public bb;
    uint256[] id_temp;
    uint leng = 0;

    function showInventory(uint _btype) public returns(uint[] memory){
        if (_btype != 0) {
            for (uint j = 0; j < bags.length; j++){
                if (_btype == bags[j].btype){
                    // bb[_btype].push(bags[j].id);
                    id_temp.push(bags[j].id);
                    leng = id_temp.length;
                }
            }
            return id_temp;
        } else{
            for (uint j = 0; j < bags.length; j++){
                    // bb[_btype].push(bags[j].id);
                    id_temp.push(bags[j].id);
        }
        return id_temp;
    }
